import React from "react";

const ContactList = (props) => {
  const contacts = props.contacts;

  if (!contacts) {
    return null;
  }

  return (
    <div>
      <h2>Contacts</h2>
      {contacts.map((contact) => (
        <div key={contact.id}>
          <p>Name: {contact.name}</p>
          <p>Email: {contact.email}</p>
          <p>Phone: {contact.phone}</p>
        </div>
      ))}
    </div>
  );
};

export default ContactList;
